import React from 'react';
import Crendentials from './Forms/Credentials';
import { Typography } from '@material-ui/core';

function App() {
  return (
    <React.Fragment>
      <Typography variant='h3'>
        PUT /credentials 
      </Typography>
      <Crendentials/>
      <br/>
      <Typography variant='h3'>
        POST /message
      </Typography>
      <Crendentials/>
    </React.Fragment>
  )
}

export default App;
